import React from 'react';

const bookedFlight = (props) => {
    return (
        <div className="BookedFlight">
            <p>{props.carrier}</p>
            <p>{props.dCity}</p>
            <p>{props.aCity}</p>
            <p>{props.date}</p>
            <p>{props.passengers}</p>
            <p>{props.bags}</p>
            <p>{props.carryOn}</p>
            <p>{props.totalPrice}</p>
        </div>
    )
}

export default bookedFlight;
